import { useEffect, useState } from "react";
import filename from "./fileicon.png"

function App() {

  const [file, setfile] = useState("")

  useEffect(()=>{

    vae

    fetch("http://localhost:5000/sendData",{
      method: 'post',
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify(file)
    })
  },[])


  return (
    <div className='file'>
      <p>Upload file</p>
      <label className='box'htmlFor="upload">
      <img src={filename} alt=""/>
        <input type='file' id='upload' size={500} hidden onChange={(e)=> setfile(e.target.files)}/>
        <p className="one">Drop your file or image</p>
        <p className="two">Maximum  file size 500 MP</p>
      </label>
      <div className='output'></div>
    </div>
  );
}

export default App;
